import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <p>Natascha Henriksen</p>
      <p>Email: nataschahenriksen@gmail.com</p>
      <p>Instagram: @natascha_henriksen</p>
      <p> Facebook: QuietlyThriving</p>
    </div>
  );
};

export default Footer;
